class AppLayout  extends Component{

    render(){
        return(
            <div className="row">
                <div className="container-fluid">
                    <h1>Trying to access store here!!</h1>
                </div>
            </div>
        );
    }
}

const mapStateToProps = (state) => {
    return {
        paymentDataArr : state.paymentData,
        requestState : state.apiRequest
